function loadImages(src, cb) {
    let loaded = 0;
    let images = [];
    for (let i = 0; i < src.length; i++) {
        loadImage(src[i], (img) => {
            loaded++;
            images[i] = img;
            if (loaded === src.length) {
                cb(images);
            }
        });
    }
}
