function Ask(options) {
    return (new Promise((resolve, reject) => {
        let closecb = (value) => {
            resolve(value);
        };
        switch (Array.isArray(options) ? "array" : (typeof options)) {
            case "array":
                options[options.length - 1].closecb = closecb;
                break;
            case "string":
                let o = {
                    msg: options,
                    closecb: closecb
                };
                options = o;
                break;
            default:
                options.closecb = closecb;
                break;
        }
        let dialog = new Dialog(options);
    }));
}
